/**
 * @description: 基础封装上增加业务功能
 */
import businessList from './businessList'
import Column from './index.js'
export default {
  components: { Column },
  props: {
    popperClass: {
      type: String,
      default: 'popper-cont'
    },
    column: {
      type: Object,
      default() {
        return {}
      }
    }
  },
  computed: {
    businessColumn() {
      return { ...businessList[this.column.business], ...this.column }
    }
  }

}
